import React, { useState } from "react";
import axios from "axios";

const AddProductForm = () => {
  const [productData, setProductData] = useState({
    name: "",
    description: "",
    quantity: "",
    date: "",
    image: "",
    carType: "",
    price: ""
  });

  const handleChange = (e) => {
    setProductData({
      ...productData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("/api/products", productData);
      console.log(response.data); // Log the response from the server
      // Handle success
    } catch (error) {
      console.error(error); // Log any errors
      // Handle error
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" value={productData.name} onChange={handleChange} />
      <input type="text" name="description" value={productData.description} onChange={handleChange} />
      <input type="number" name="quantity" value={productData.quantity} onChange={handleChange} />
      <input type="date" name="date" value={productData.date} onChange={handleChange} />
      <input type="text" name="image" value={productData.image} onChange={handleChange} />
      <input type="text" name="carType" value={productData.carType} onChange={handleChange} />
      <input type="number" name="price" value={productData.price} onChange={handleChange} />
      <button type="submit">Add Product</button>
    </form>
  );
};

export default AddProductForm;
